column13:
A class of substituted phenylacetonitrilealkylaminoalkyl-ortho-substituted aryl compounds having immunosuppressive properties is described. Compounds of this class would be useful in reducing recipient rejection of transplanted organs and for treatment of autoimmune or inflammatory diseases. Compounds of particular interest are of the formula

 wherein m is one or two; wherein n is a number selected from one to five, inclusive; wherein R¹ is selected from hydrido, alkyl, hydroxyalkyl, cycloalkyl, cycloalkylalkyl, alkoxyalkyl, alkenyl and alkynyl; wherein R⁶ is selected from loweralkyl; 
wherein each of R⁸, R⁹, R¹⁰ and R¹² through R¹⁶ is independently selected from hydrido, hydroxy, alkyl, hydroxyalkyl, alkoxy, alkenyl, alkynyl, alkylcarbonyl, alkoxycarbonyl, alkylcarbonylalkenyl, alkylaminocarbonyl and alkoxyalkyl; with the proviso that at least one of R¹² and R¹⁶ must be selected from hydroxy, alkyl, hydroxyalkyl, alkoxy, alkenyl, alkynyl, alkylcarbonyl, alkoxycarbonyl, alkylcarbonylalkenyl, alkylaminocarbonyl and alkoxyalkyl; or a tautomer thereof or a pharmaceutically-acceptable salt thereof.
